description:
Movie Info: ddarammayilatho (English: With Two Girls) is a 2013 Telugu melodrama, romance film. The film, directed by Puri Jagannadh, stars Allu Arjun, Amala Paul, Catherine Tresa and Shawar Ali in the lead roles. The film was entirely shot in Spain and Paris. Bandla Ganesh has produced the film under Parameswara Art Productions. The film was simultaneously dubbed and released in Malayalam as Romeo &amp; Juliets.

